function Print(map) {
    this.map = map;
    this.control = null;
    this.PIXEL_SIZE = 3.779528;   	
    this.MAP_WIDTH_MM = 270;
    this.MAP_HEIGHT_MM = 250;
    this.initialize(); 
}
   
Print.prototype = {
    initialize: function() {
        var _this = this;
        var m = this.map;
        this.control = L.easyButton('fa-print', function(btn, m){
            _this.print();
        }, 'Imprimir');
    },

    print: function() {
        var _this = this;

        var mask = '<div id="animationload" class="animationload"><div class="osahanloading"></div></div>';
        $('body').append(mask);

        //var imgData = 'data:image/png;base64,';
        var logoOpp = 'data:image/png;base64,';
        var logoPresidencia = 'data:image/png;base64,';
        var doc = new jsPDF('landscape', 'mm', 'a4');

        doc.addImage(logoOpp, 'PNG', 15, 15, 30, 10);
        doc.addImage(logoPresidencia, 'PNG', 256, 8, 30, 20);

        doc.setFontSize(24);
        doc.setTextColor(5, 90, 5);
        doc.text(70, 22, 'Sistema de inventario de Caminería Rural');

        leafletImage(this.map, function(err, canvas) {
            var dataUrl = _this.canvasToImage(canvas, '#ffffff');

            var pdfMapWidthInPx = parseInt(_this.MAP_WIDTH_MM * _this.PIXEL_SIZE);
			var pdfMapHeightInPx = parseInt(_this.MAP_HEIGHT_MM * _this.PIXEL_SIZE);
            var newSize = _this.calculateAspectRatioFit(_this.map.getSize().x, _this.map.getSize().y, pdfMapWidthInPx, pdfMapHeightInPx);		
			var mmNewWidth = newSize.width / _this.PIXEL_SIZE;
			var mmNewHeight= newSize.height / _this.PIXEL_SIZE;
            doc.addImage(dataUrl, 'PNG', 15, 30, mmNewWidth, mmNewHeight+20);

            doc.setFontSize(10);
            doc.setTextColor(12, 12, 12);
            doc.text(100, 195, 'Torre Ejecutiva Sur, piso 7 | Liniers 1324, Montevideo - Uruguay');
            doc.text(120, 200, 'Tel. (+598 2) 150  | www.opp.gub.uy');

            var uri = doc.output('dataurlstring');
            _this.openDataUriWindow(uri);
            $('#animationload').remove();
        });
    },

    canvasToImage: function(canvas, backgroundColor){
        //cache height and width		
        var w = canvas.width;
        var h = canvas.height;
        
        var context = canvas.getContext("2d");
     
        var data;
     
        if(backgroundColor)
        {
            //get the current ImageData for the canvas.
            data = context.getImageData(0, 0, w, h);
     
            //store the current globalCompositeOperation
            var compositeOperation = context.globalCompositeOperation;
     
            //set to draw behind current content
            context.globalCompositeOperation = "destination-over";
     
            //set background color
            context.fillStyle = backgroundColor;
     
            //draw background / rect on entire canvas
            context.fillRect(0,0,w,h);
        }
     
        //get the image data from the canvas
        var imageData = canvas.toDataURL("image/jpeg");
     
        if(backgroundColor)
        {
            //clear the canvas
            context.clearRect (0,0,w,h);
     
            //restore it with original / cached ImageData
            context.putImageData(data, 0,0);
     
            //reset the globalCompositeOperation to what it was
            context.globalCompositeOperation = compositeOperation;
        }
     
        //return the Base64 encoded data url string
        return imageData;
    },

    calculateAspectRatioFit: function(srcWidth, srcHeight, maxWidth, maxHeight) {
        var ratio = [(maxWidth / srcWidth), (maxHeight / srcHeight) ];
        ratio = Math.min(ratio[0], ratio[1]);

        return { width:srcWidth*ratio, height:srcHeight*ratio };
     },

    openDataUriWindow: function(url) {
        var html = '<html>' +
            '<style>html, body { padding: 0; margin: 0; } iframe { width: 100%; height: 100%; border: 0;}  </style>' +
            '<body>' +
            '<iframe id="pdf-iframe" src="' + url + '"></iframe>' +
            '</body></html>';
        a = window.open("", "_blank");
        a.document.write(html);
    },

    getControl: function(){
        return this.control;
    }
}
   
module.exports = Print;